import React, { Component } from 'react'
import Register from './registerModal'
import { Paper, Button } from '@material-ui/core'
import PersonAddIcon from '@material-ui/icons/PersonAdd';
import ErrorIcon from '@material-ui/icons/Error';

class RegisterMain extends Component{

    state = {
        showRegisterFlow: false
    }

    render(){

        let welcomeStyle = {textAlign: 'center'}
        let buttonStyle = {marginLeft: '30px',marginRight: '30px', marginTop: '50px', fontSize: '25px', textAlign: 'left', width: '100%'}

        let welcome = 
        <div style={welcomeStyle}>
                <Button style={buttonStyle} onClick={() => {this.setState({showRegisterFlow: true})}}>
                <PersonAddIcon style={{fontSize: '50px'}}/>
                    <span>Register a Parent Plate</span>
                </Button>
                <Button style={buttonStyle} onClick={() => {this.setState({showRegisterFlow: true})}}>
                    <ErrorIcon/>
                    <span>Register a High Risk Plate</span>
                </Button>
        </div>

        let current = this.state.showRegisterFlow ? <Register/> : welcome

        return(
            <Paper style={{height: '650px', width: '100%', textAlign: 'center', backgroundColor: '#E5E5E5'}}>
                {current}
            </Paper>
        )
    }

}

export default RegisterMain
